import React, { useEffect, useState } from "react";
import "./OurModels.scss";
import Header from "../Header/Header";
import Footer from "../Footer/Footer";
import { Link } from "react-router-dom";

const OurModels = () => {
  const [models, setModels] = useState([]);
  const [showMore, setShowMore] = useState(false);

  useEffect(() => {
    const fetchModels = async () => {
      try {
        const response = await fetch(
          "http://127.0.0.1:8000/models/main/?limit=12"
        );
        if (!response.ok) throw new Error("Failed to fetch models");

        const data = await response.json();
        setModels(data.results);
      } catch (error) {
        console.error("Error fetching models:", error);
      }
    };

    fetchModels();
  }, []);

  return (
    <>
      <Header />

      <main className="main">
        <section className="our-models">
          <div className="our-models__title">
            <h2 className="our-models__title-text">
              Connect with our top models worldwide. Effortless talent search
              <br /> to bring your vision to life.
            </h2>
          </div>

          <div className="our-models__block">
            {models.slice(0, 6).map((model, index) => (
              <Link
                to={`/models/${model.category}/${model.id}`}
                key={index}
                className="our-models__link"
              >
                <div className="our-models__card">
                  <div className="our-models__img">
                    <img src={model.image_url} alt={model.full_name || "Model"} />
                  </div>
                  <div className="our-models__info">
                    <div className="our-models__name">{model.full_name || "Loading..."}</div>
                    <div className="our-models__location">
                      {model.city || "City"}, {model.country || "Country"}
                    </div>
                  </div>
                </div>
              </Link>
            ))}
          </div>

          {/* Остальные 6 моделей (появляются после клика на "Show more") */}
          {showMore && (
            <div className="our-models__block our-models__block-third">
              {models.slice(6, 12).map((model, index) => (
                <Link
                  to={`/models/${model.category}/${model.id}`}
                  key={index}
                  className="our-models__link"
                >
                  <div className="our-models__card">
                    <div className="our-models__img">
                      <img src={model.image_url} alt={model.full_name || "Model"} />
                    </div>
                    <div className="our-models__info">
                      <div className="our-models__name">{model.full_name || "Loading..."}</div>
                      <div className="our-models__location">
                        {model.city || "City"}, {model.country || "Country"}
                      </div>
                    </div>
                  </div>
                </Link>
              ))}
            </div>
          )}

          {!showMore && models.length > 6 && (
            <div className="our-models__btn">
              <div className="our-models__btn-show" onClick={() => setShowMore(true)}>
                Show more
              </div>
            </div>
          )}
        </section>
      </main>

      <Footer />
    </>
  );
};

export default OurModels;
